// ==UserScript==
// @name         Site Search
// @namespace    https://space.bilibili.com/356927809/
// @source       https://github.com/LuckyPuppy514/tampermonkey/blob/main/Site Search.user.js
// @version      2.0
// @description  This is a script enable us to config type-url to use site search more convenient. 这是一个可以让我们通过配置类型-网址，使得google site搜索更方便的脚本。
// @author       LuckyPuppy514
// @connect      google.com
// @include      *://*.google*/
// @include      *://*.google*/webhp*
// @include      *://*.google*/search*
// @v1.2         type == OFF时，不进行site:截取
// @v1.3         快捷方式bug修复
// @v2.0         add shortcut MULTI useage(type case not sensitive): search value site:type1,type2,type3
// @v2.0         new type case not sensitive(case can be anyway as you want like this: MoVie ...)
// @v2.0         新增复合快捷方式用法（类型大小写不敏感）：查询内容 site:类型1,类型2,类型3
// @v2.0         新增类型大小写不敏感（可以按你所需随意大小写，例如：MoVie ...）
// @icon         data:image/png;base64,
// @grant        none
// @license      GPL-3.0-only
// ==/UserScript==

(function() {
    'use strict';

    // type-url config 类型-网址 配置
    // you can config by yourself（warn：first char must be uppercase, v2.0 didn't need to be uppercase）
    // 可自行配置（首字母必须大写，v2.0 不再需要大写）
    // www can be remove. it search more result, may cause wrong result in xxx.domain.
    // 域名中的www可以去除。这可以查询到更多结果，但可能会出现xxx.域名中的错误结果。
    const typeUrlMap = new Map();
    typeUrlMap.set('Movie',['uump4.net', 'mp44k.com', 'proxyrarbg.org', 'pirateproxy.tube']);
    typeUrlMap.set('Serial', ['meijutt.tv', 'meijumi.net']);
    typeUrlMap.set('Subtitle', ['subhd.tv']);
    typeUrlMap.set('Anime', ['yhdmp.net']);
    typeUrlMap.set('Code', ['stackoverflow.com','jianshu.com','csdn.net']);

    // cookie save day cookie保留天数
    var cookieSaveDays = 7;


    // special config(WARN: DON'T EDIT) 特殊配置（警告：不要编辑）
    typeUrlMap.set('MULTI', '');
    typeUrlMap.set('ALL', '');
    typeUrlMap.set('OFF','');

    var locationParent = document.getElementsByClassName('XDyW0e');
    var searchInput = document.getElementsByName('q');
    var siteUrl = "";

    // create site url 生成site url
    var all = '';
    const typeSiteUrlMap = new Map();
    typeUrlMap.forEach(function(value, key){
        key = key.toUpperCase();
        if(key != 'OFF' && key != 'ALL' && key != 'MULTI'){
            var urls = '';
            for(let url of value){
                urls = urls + ' OR site:' + url;
            }
            all = all + urls;
            urls = urls.substring(urls.indexOf('OR ') + 3);
            typeSiteUrlMap.set(key, urls);
        }
    })
    typeSiteUrlMap.set('MULTI', '');
    typeSiteUrlMap.set('ALL', all.substring(all.indexOf('OR ') + 3));
    typeSiteUrlMap.set('OFF', '');
    // console.log(typeSiteUrlMap);

    // create type selector 创建类型选择器
    let typeSelect = document.createElement('div');
    typeSelect.style = 'border: none; padding: 8px 2px;';
    var typeSelectHtml = "<select id='typeSelect' style='cursor:pointer; background-color: rgb(245,245,239); border: 1px solid rgb(244,242,239); border-radius: 3px; padding: 5px 0px; text-align: left; text-decoration: none; display: inline-block;'>"
    for(let key of typeUrlMap.keys()){
        typeSelectHtml = typeSelectHtml + "<option value = '" + key.toUpperCase() + "' selected>" + key + "</option>";
    }
    typeSelectHtml = typeSelectHtml + '</select>';
    typeSelect.innerHTML = typeSelectHtml;


    window.onload = function () {
        // add typeSelect event 添加类型选择器事件
        var ts = document.getElementById("typeSelect");
        ts.onchange = function () {
            siteUrl = typeSiteUrlMap.get(this.value);
            setCookie("type", this.value, cookieSaveDays);
        }

        // load type from cookie 加载保存在cookie中的类型
        var type = getCookie('type');
        console.log(type);
        if(type != undefined && type != null && type != ''){
            ts.value = type;
            typeSiteUrlMap.set('MULTI', getCookie('MULTIUrl'));
            siteUrl = typeSiteUrlMap.get(type);
        }
    }


    // create site search button 创建site搜索按钮
    let ssButton = document.createElement('div');
    ssButton.style = "border: none; padding: 8px 2px;";
    ssButton.innerHTML = "<input value='Site Search' aria-label='Site Search' name='ssButton' role='button' tabindex='0' type='submit' style='cursor:pointer; background-color: rgb(245,245,239); border: 1px solid rgb(244,242,239); border-radius: 3px; padding: 5px 5px; text-align: center; text-decoration: none; display: inline-block;'>";
    // site search button event site搜索按钮事件
    ssButton.onclick =function(){
        // if input value length > 0 then search
        if (searchInput[0].value.length > 0){
            var index = searchInput[0].value.indexOf("site:");
            var type = getCookie('type');
            if(index != -1){
                // shortcut 快捷方式
                // usage 用法：searchValue site:type
                var key = searchInput[0].value.substring(index + 5).trim();
                key = key.toUpperCase();
                var shortcut = 0;
                if(key.indexOf(',') != -1){
                    var keys = key.split(',');
                    siteUrl = '';
                    for(let item of keys){
                        if(typeSiteUrlMap.get(item) != undefined){
                            siteUrl = siteUrl + ' OR ' + typeSiteUrlMap.get(item);
                        }
                    }
                    siteUrl = siteUrl.substring(siteUrl.indexOf('OR ') + 3);
                    setCookie('type', 'MULTI', cookieSaveDays);
                    setCookie('MULTIUrl', siteUrl, cookieSaveDays);
                    shortcut = 1;

                } else if(typeSiteUrlMap.get(key) != undefined){
                    siteUrl = typeSiteUrlMap.get(key);
                    setCookie('type', key, cookieSaveDays);
                    shortcut = 1;

                }
                if(shortcut == 1 || type != 'OFF'){
                    searchInput[0].value = searchInput[0].value.substring(0, index - 1);
                }
            }
            console.log(key);
            console.log(siteUrl);
            console.log(searchInput[0].value);

            if(siteUrl.length > 0){
                searchInput[0].value = searchInput[0].value + ' ' + siteUrl;
            }
        }
    }


    // add to designated position 添加到指定位置
    locationParent[0].after(typeSelect);
    // locationParent[0].after(typeCheckbox);
    locationParent[0].after(ssButton);


    // cookie function
    function setCookie(cname,cvalue,exdays){
        var d = new Date();
        d.setTime(d.getTime()+(exdays*24*60*60*1000));
        var expires = "expires="+d.toGMTString();
        document.cookie = cname+"="+cvalue+"; "+expires;
    }
    function getCookie(cname){
        var name = cname + "=";
        var ca = document.cookie.split(';');
        for(var i=0; i<ca.length; i++) {
            var c = ca[i].trim();
            if (c.indexOf(name)==0) { return c.substring(name.length,c.length); }
        }
        return "";
    }
})();
